import React from 'react';
import {
  Box,
  Typography,
  Container,
  Grid,
  Card,
  CardContent,
  LinearProgress,
  Chip,
} from '@mui/material';
import {
  Code,
  Web,
  Build,
  Psychology,
} from '@mui/icons-material';

const Skills = () => {
  const skillCategories = [
    {
      title: 'Programming Languages',
      icon: <Code />,
      skills: [
        { name: 'JavaScript', level: 90, color: '#f7df1e' },
        { name: 'Python', level: 85, color: '#3776ab' },
        { name: 'Java', level: 80, color: '#ed8b00' },
        { name: 'C++', level: 75, color: '#00599c' },
        { name: 'TypeScript', level: 70, color: '#3178c6' },
      ]
    },
    {
      title: 'Web Development',
      icon: <Web />,
      skills: [
        { name: 'React', level: 88, color: '#61dafb' },
        { name: 'Node.js', level: 82, color: '#339933' },
        { name: 'HTML/CSS', level: 92, color: '#e34f26' },
        { name: 'Express.js', level: 78, color: '#000000' },
        { name: 'MongoDB', level: 75, color: '#47a248' },
      ]
    },
    {
      title: 'Tools & Technologies',
      icon: <Build />,
      skills: [
        { name: 'Git', level: 85, color: '#f05032' },
        { name: 'Docker', level: 70, color: '#2496ed' },
        { name: 'AWS', level: 65, color: '#ff9900' },
        { name: 'Linux', level: 80, color: '#fcc624' },
        { name: 'VS Code', level: 90, color: '#007acc' },
      ]
    },
    {
      title: 'Data & AI',
      icon: <Psychology />,
      skills: [
        { name: 'Machine Learning', level: 70, color: '#ff6f00' },
        { name: 'Data Analysis', level: 75, color: '#306998' },
        { name: 'SQL', level: 80, color: '#336791' },
        { name: 'TensorFlow', level: 65, color: '#ff6f00' },
        { name: 'Pandas', level: 78, color: '#150458' },
      ]
    }
  ];

  const learningItems = ['React Native', 'GraphQL', 'Kubernetes', 'Next.js'];
  const goals = [
    'Master cloud architecture',
    'Contribute to open source',
    'Build a SaaS product',
    'Learn DevOps practices'
  ];

  return (
    <Container maxWidth="lg" sx={{ py: 8 }}>
      {/* Header */}
      <Box sx={{ textAlign: 'center', mb: 6 }}>
        <Typography
          variant="h2"
          sx={{
            mb: 2,
            background: 'linear-gradient(135deg, #ffffff, #4dabf7)',
            backgroundClip: 'text',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            position: 'relative',
            '&::after': {
              content: '""',
              position: 'absolute',
              bottom: -10,
              left: '50%',
              transform: 'translateX(-50%)',
              width: 60,
              height: 4,
              background: 'linear-gradient(135deg, #4dabf7, #f50057)',
              borderRadius: 2,
            },
          }}
        >
          Technical Skills
        </Typography>
        <Typography
          variant="h6"
          sx={{ color: 'text.secondary', maxWidth: 600, mx: 'auto' }}
        >
          Technologies I work with
        </Typography>
      </Box>

      {/* Skills Grid */}
      <Grid container spacing={3} sx={{ mb: 6 }}>
        {skillCategories.map((category, categoryIndex) => (
          <Grid item xs={12} md={6} key={categoryIndex}>
            <Card
              sx={{
                height: '100%',
                transition: 'transform 0.3s ease, box-shadow 0.3s ease',
                '&:hover': {
                  transform: 'translateY(-5px)',
                  boxShadow: '0 20px 40px rgba(74, 171, 247, 0.2)',
                },
              }}
            >
              <CardContent sx={{ p: 3 }}>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
                  <Box sx={{ color: 'primary.main', mr: 1, fontSize: '2rem' }}>
                    {category.icon}
                  </Box>
                  <Typography variant="h5" sx={{ fontWeight: 600 }}>
                    {category.title}
                  </Typography>
                </Box>

                <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
                  {category.skills.map((skill, skillIndex) => (
                    <Box key={skillIndex}>
                      <Box
                        sx={{
                          display: 'flex',
                          justifyContent: 'space-between',
                          alignItems: 'center',
                          mb: 1,
                        }}
                      >
                        <Typography variant="body1" sx={{ fontWeight: 500 }}>
                          {skill.name}
                        </Typography>
                        <Typography
                          variant="body2"
                          sx={{ color: 'text.secondary', fontWeight: 600 }}
                        >
                          {skill.level}%
                        </Typography>
                      </Box>
                      <LinearProgress
                        variant="determinate"
                        value={skill.level}
                        sx={{
                          height: 8,
                          borderRadius: 4,
                          backgroundColor: 'rgba(74, 171, 247, 0.2)',
                          '& .MuiLinearProgress-bar': {
                            borderRadius: 4,
                            background: `linear-gradient(90deg, ${skill.color}, #4dabf7)`,
                            animation: `fillBar 1.5s ease-out forwards`,
                            animationDelay: `${categoryIndex * 0.1 + skillIndex * 0.1}s`,
                            '@keyframes fillBar': {
                              from: {
                                transform: 'scaleX(0)',
                                transformOrigin: 'left',
                              },
                              to: {
                                transform: 'scaleX(1)',
                              },
                            },
                          },
                        }}
                      />
                    </Box>
                  ))}
                </Box>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* Learning & Goals Section */}
      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent sx={{ p: 3 }}>
              <Typography
                variant="h5"
                sx={{
                  fontWeight: 600,
                  mb: 2,
                  display: 'flex',
                  alignItems: 'center',
                  gap: 1,
                }}
              >
                ðŸŽ¯ What I'm Currently Learning
              </Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                {learningItems.map((item, index) => (
                  <Chip
                    key={index}
                    label={item}
                    color="primary"
                    variant="filled"
                    sx={{
                      fontWeight: 500,
                      transition: 'transform 0.3s ease',
                      '&:hover': {
                        transform: 'scale(1.05)',
                      },
                    }}
                  />
                ))}
              </Box>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} md={6}>
          <Card>
            <CardContent sx={{ p: 3 }}>
              <Typography
                variant="h5"
                sx={{
                  fontWeight: 600,
                  mb: 2,
                  display: 'flex',
                  alignItems: 'center',
                  gap: 1,
                }}
              >
                ðŸš€ Next Goals
              </Typography>
              <Box component="ul" sx={{ pl: 0, m: 0, listStyle: 'none' }}>
                {goals.map((goal, index) => (
                  <Box
                    component="li"
                    key={index}
                    sx={{
                      py: 0.5,
                      position: 'relative',
                      pl: 2,
                      '&::before': {
                        content: '"â†’"',
                        position: 'absolute',
                        left: 0,
                        color: 'primary.main',
                        fontWeight: 'bold',
                      },
                      '&:hover': {
                        color: 'primary.main',
                        transform: 'translateX(5px)',
                        transition: 'all 0.3s ease',
                      },
                    }}
                  >
                    <Typography variant="body1">{goal}</Typography>
                  </Box>
                ))}
              </Box>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Skills;
